import React, { useRef } from 'react';
import { Facebook, Twitter, Youtube, Instagram, Briefcase, Phone } from 'lucide-react';

// Contact Component (based on your existing code)
const Contact = () => {
    const form = useRef();

    const sendEmail = (e) => {
        e.preventDefault();
        
        // Simulating EmailJS functionality (replace with your actual EmailJS code)
        console.log('Form submitted');
        alert('Email Sent !');
        e.target.reset();
        
        // Your actual EmailJS code would be:
        // emailjs.sendForm('service_6phm4ar', 'template_zcxds5a', form.current, 'blaHt_5KIJ711DfGH')
        //     .then((result) => {
        //         console.log(result.text);
        //         e.target.reset();
        //         alert('Email Sent !');
        //     }, (error) => {
        //         console.log(error.text);
        //     });
    };

    return (
        <div id='contactPage' className="min-h-screen bg-gray-900 py-20 px-4 flex items-center justify-center">
            <div id="contact" className="w-full max-w-2xl">
                <h1 className="text-5xl font-bold text-center text-white mb-6">Contact Me</h1>
                <p className="text-lg text-gray-300 text-center mb-12">
                    Please fill out the form below to discuss any work opportunities.
                </p>
                <form className="space-y-6" ref={form} onSubmit={sendEmail}>
                    <input 
                        type="text" 
                        className="w-full p-4 bg-gray-800 border-2 border-transparent rounded-lg text-white placeholder-gray-400 focus:border-yellow-400 focus:outline-none transition-colors" 
                        placeholder='Your name' 
                        name='from_name' 
                        required
                    />
                    <input 
                        type="email" 
                        className="w-full p-4 bg-gray-800 border-2 border-transparent rounded-lg text-white placeholder-gray-400 focus:border-yellow-400 focus:outline-none transition-colors" 
                        placeholder='Your Email' 
                        name='from_email' 
                        required
                    />
                    <textarea 
                        name="message" 
                        placeholder='Your Message' 
                        rows={5} 
                        className="w-full p-4 bg-gray-800 border-2 border-transparent rounded-lg text-white placeholder-gray-400 focus:border-yellow-400 focus:outline-none transition-colors resize-vertical"
                        required
                    />
                    <button 
                        type="submit" 
                        className="w-full bg-yellow-400 hover:bg-yellow-300 text-gray-900 font-semibold py-4 px-8 rounded-lg transition-all duration-300 hover:transform hover:-translate-y-1"
                    >
                        Submit
                    </button>
                    <div className="flex justify-center space-x-6 mt-8">
                        <Facebook className="w-8 h-8 text-gray-400 hover:text-blue-500 cursor-pointer transition-colors" />
                        <Twitter className="w-8 h-8 text-gray-400 hover:text-blue-400 cursor-pointer transition-colors" />
                        <Youtube className="w-8 h-8 text-gray-400 hover:text-red-500 cursor-pointer transition-colors" />
                        <Instagram className="w-8 h-8 text-gray-400 hover:text-pink-500 cursor-pointer transition-colors" />
                    </div>
                </form>
            </div>
        </div>
    );
};

// Header Component
const Header = ({ scrollToContact }) => {
    return (
        <header className="fixed top-0 w-full bg-gray-800 bg-opacity-95 backdrop-blur-sm z-50 px-6 py-4">
            <div className="flex justify-between items-center max-w-7xl mx-auto">
                <div className="text-2xl font-bold text-yellow-400">W.</div>
                <nav className="hidden md:flex space-x-8">
                    <a href="#home" className="text-white hover:text-yellow-400 transition-colors">Home</a>
                    <a href="#about" className="text-white hover:text-yellow-400 transition-colors">About</a>
                    <a href="#portfolio" className="text-white hover:text-yellow-400 transition-colors">Portfolio</a>
                    <a href="#articles" className="text-white hover:text-yellow-400 transition-colors">Articles</a>
                </nav>
                <button 
                    onClick={scrollToContact}
                    className="bg-white text-gray-800 px-6 py-2 rounded-full font-medium hover:bg-yellow-400 transition-all duration-300 hover:transform hover:-translate-y-1 flex items-center space-x-2"
                >
                    <Phone className="w-4 h-4" />
                    <span>Contact Me</span>
                </button>
            </div>
        </header>
    );
};

// Hero Section Component
const Hero = ({ scrollToContact }) => {
    return (
        <section id="home" className="min-h-screen bg-gray-800 flex items-center justify-center px-6 pt-20">
            <div className="max-w-7xl w-full grid md:grid-cols-2 gap-12 items-center">
                <div className="space-y-6">
                    <h2 className="text-xl text-gray-300">Hello</h2>
                    <h1 className="text-5xl md:text-6xl font-bold text-white leading-tight">
                        I'm <span className="text-yellow-400">Hillary Onyango Amolo</span>
                    </h1>
                    <h3 className="text-3xl md:text-4xl font-bold text-white">Data Engineer</h3>
                    <p className="text-lg text-gray-300 leading-relaxed max-w-lg">
                        I am a skilled and detail-oriented data engineer passionate in building 
                        scalable data pipelines, managing large datasets, and transforming raw data 
                        into actionable insights for data-driven decision making.
                    </p>
                    <button 
                        onClick={scrollToContact}
                        className="bg-white text-gray-800 px-8 py-4 rounded-full font-semibold text-lg hover:bg-yellow-400 transition-all duration-300 hover:transform hover:-translate-y-2 flex items-center space-x-3 shadow-lg hover:shadow-xl"
                    >
                        <Briefcase className="w-5 h-5" />
                        <span>Hire Me</span>
                    </button>
                </div>
                <div className="flex justify-center">
                    <div className="w-80 h-80 rounded-2xl overflow-hidden shadow-2xl">
                        <img 
                            src="https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=387&q=80" 
                            alt="Hillary Onyango Amolo" 
                            className="w-full h-full object-cover"
                        />
                    </div>
                </div>
            </div>
        </section>
    );
};

// Main App Component
const App = () => {
    // Smooth scroll function
    const scrollToContact = () => {
        const contactSection = document.getElementById('contactPage');
        if (contactSection) {
            contactSection.scrollIntoView({
                behavior: 'smooth',
                block: 'start'
            });
        }
    };

    return (
        <div className="bg-gray-800 text-white">
            <Header scrollToContact={scrollToContact} />
            <Hero scrollToContact={scrollToContact} />
            <Contact />
        </div>
    );
};

export default App;
